# Copy from location extension
CREATE TABLE `location` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `level0` varchar(255),
  `level1` varchar(255),
  `level2` varchar(255),
  `level3` varchar(255),
  `level4` varchar(255),
  `level5` varchar(255),
  `label` varchar(255),
  `lat` varchar(255),
  `lng` varchar(255),
  `disabled` tinyint(1),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `request` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `date_created` datetime NOT NULL,
  `last_updated` datetime NOT NULL,
  `location_id` bigint(20),
  `detail` text,
  
  `extra_location0` varchar(255),
  `extra_location1` varchar(255),
  `extra_location2` varchar(255),
  `extra_location3` varchar(255),
  `extra_location4` varchar(255),
  
  `extra_text0` text,
  `extra_text1` text,
  `extra_text2` text,
  `extra_text3` text,
  `extra_text4` text,
  `extra_text5` text,
  `extra_text6` text,
  `extra_text7` text,
  `extra_text8` text,
  `extra_text9` text,
  `extra_text10` text,
  `extra_text11` text,
  `extra_text12` text,
  `extra_text13` text,
  `extra_text14` text,
  
  `extra_double0` double,
  `extra_double1` double,
  `extra_double2` double,
  `extra_double3` double,
  `extra_double4` double,
  `extra_double5` double,
  `extra_double6` double,
  `extra_double7` double,
  `extra_double8` double,
  `extra_double9` double,
  
  `status` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_request_location_id` (`location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `coordinator` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `fullname` varchar(255) NOT NULL,
  `position` varchar(255),
  `tel` varchar(255),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `request_coordinator` (    
  `request_id` bigint(20) DEFAULT NULL,
  `coordinator_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`request_id`, `coordinator_id`),
  KEY `fk_request_coordinator_request_id` (`request_id`),
  KEY `fk_request_coordinator_coordinator_id` (`coordinator_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `need` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  #`name` varchar(255) NOT NULL,
  `item_id` bigint(20) NOT NULL,
  `amount` int(11) NOT NULL DEFAULT 0,
  `detail` text,
  `request_id` bigint(20) NOT NULL,
  `status` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_need_item_id` (`item_id`),
  KEY `fk_need_request_id` (`request_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

# Donate ================================================================================================================
CREATE TABLE `stock_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `donator_id` bigint(20) NOT NULL,
  `item_id` bigint(20) NOT NULL,
  `amount` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `fk_stock_item_donator_id` (`donator_id`),
  KEY `fk_stock_item_item_id` (`item_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;
    
CREATE TABLE `item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `name` varchar(255) NOT NULL,
  `category_item_id` bigint(20),
  `image_url` varchar(255),
  PRIMARY KEY (`id`),
  KEY `fk_item_category_item_id` (`category_item_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `category_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `name` varchar(255) NOT NULL,
  `image_url` varchar(255),
  `detail` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `donated_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `donator_id` bigint(20) NOT NULL,
  `item_id` bigint(20) NOT NULL,
  `amount` int(11) NOT NULL DEFAULT 0,
  `need_id` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_donated_item_item_id` (`item_id`),
  KEY `fk_donated_item_need_id` (`need_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `donator` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,

  `fullname` varchar(255) NOT NULL,
  `tel` varchar(255),
  `location_id` bigint(20),
  `image_url` varchar(255),
  `detail` text,
  PRIMARY KEY (`id`),
  KEY `fk_donator_location_id` (`location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

# Transport ==============================================================================================================
CREATE TABLE `stock_vehicle` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `transporter_id` bigint(20) NOT NULL,
  `vehicle_id` bigint(20) NOT NULL,
  `amount` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `fk_stock_vehicle_transporter_id` (`transporter_id`),
  KEY `fk_stock_vehicle_vehicle_id` (`vehicle_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;
    
CREATE TABLE `vehicle` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `name` varchar(255) NOT NULL,
  `image_url` varchar(255),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `shipment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `transporter_id` bigint(20) NOT NULL,
  `vehicle_id` bigint(20) NOT NULL,
  `amount` int(11) NOT NULL DEFAULT 0,
  `need_id` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_transporter_vehicle_vehicle_id` (`vehicle_id`),
  KEY `fk_transporter_vehicle_need_id` (`need_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `transporter` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `fullname` varchar(255) NOT NULL,
  `tel` varchar(255),
  `location_id` bigint(20),
  `image_url` varchar(255),
  `detail` text,
  PRIMARY KEY (`id`),
  KEY `fk_transporter_location_id` (`location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

# Content ==============================================================================================================

CREATE TABLE `content` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `type` varchar(60) NOT NULL,
  `date_created` datetime NOT NULL,
  `last_updated` datetime NOT NULL,
  `title` varchar(255) NOT NULL,
  `detail` text,

  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `username` varchar(128) NOT NULL,
  `password` varchar(128) NOT NULL,
  `email` varchar(128),
  `group` varchar(128),
  `type` varchar(128),
  `status` int(2) DEFAULT 0,
  
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `webform` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  
  `type` varchar(60) NOT NULL,
  `date_created` datetime NOT NULL,
  `last_updated` datetime NOT NULL,
  `title` varchar(255),
  `user_id` bigint(20),
  `data` text,
  
  `filter0` varchar(128),
  `filter1` varchar(128),
  `filter2` varchar(128),
  `filter3` varchar(128),
  `filter4` varchar(128),
  `filter5` varchar(128),
  `filter6` varchar(128),
  `filter7` varchar(128),
  `filter8` varchar(128),
  `filter9` varchar(128),
  `filter10` varchar(128),
  `filter11` varchar(128),
  `filter12` varchar(128),
  `filter13` varchar(128),
  `filter14` varchar(128),
  `filter15` varchar(128),
  `filter16` varchar(128),
  `filter17` varchar(128),
  `filter18` varchar(128),
  `filter19` varchar(128),
  `filter20` varchar(128),
  `filter21` varchar(128),
  `filter22` varchar(128),
  `filter23` varchar(128),
  `filter24` varchar(128),
  `filter25` varchar(128),
  `filter26` varchar(128),
  `filter27` varchar(128),
  `filter28` varchar(128),
  `filter29` varchar(128),
  `filter30` varchar(128),
  `filter31` varchar(128),
  `filter32` varchar(128),
  `filter33` varchar(128),
  `filter34` varchar(128),
  `filter35` varchar(128),
  `filter36` varchar(128),
  `filter37` varchar(128),
  `filter38` varchar(128),
  `filter39` varchar(128),
  
  PRIMARY KEY (`id`),
  KEY `fk_webform_user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

CREATE TABLE `webform_location` (
  `webform_id` bigint(20) NOT NULL,
  `location_id` bigint(20) NOT NULL,
  
  PRIMARY KEY (`webform_id`, `location_id`),
  KEY `fk_webform_location_webform_id` (`webform_id`),
  KEY `fk_webform_location_location_id` (`location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


ALTER TABLE `request`
  ADD CONSTRAINT `fk_request_location_id` FOREIGN KEY (`location_id`) REFERENCES `location` (`id`);

ALTER TABLE `request_coordinator`
  ADD CONSTRAINT `fk_request_coordinator_request_id` FOREIGN KEY (`request_id`) REFERENCES `request` (`id`),
  ADD CONSTRAINT `fk_request_coordinator_coordinator_id` FOREIGN KEY (`coordinator_id`) REFERENCES `coordinator` (`id`);
  
  
ALTER TABLE `need`
  ADD CONSTRAINT `fk_need_item_id` FOREIGN KEY (`item_id`) REFERENCES `item` (`id`),
  ADD CONSTRAINT `fk_need_request_id` FOREIGN KEY (`request_id`) REFERENCES `request` (`id`);
  
# Donate ================================================================================================================
ALTER TABLE `stock_item`
  ADD CONSTRAINT `fk_stock_item_donator_id` FOREIGN KEY (`donator_id`) REFERENCES `donator` (`id`),
  ADD CONSTRAINT `fk_stock_item_item_id` FOREIGN KEY (`item_id`) REFERENCES `item` (`id`);
  
ALTER TABLE `item`
  ADD CONSTRAINT `fk_item_category_item_id` FOREIGN KEY (`category_item_id`) REFERENCES `category_item` (`id`);

ALTER TABLE `donated_item`
  ADD CONSTRAINT `fk_donated_item_donator_id` FOREIGN KEY (`donator_id`) REFERENCES `donator` (`id`),
  ADD CONSTRAINT `fk_donated_item_item_id` FOREIGN KEY (`item_id`) REFERENCES `item` (`id`),
  ADD CONSTRAINT `fk_donated_item_need_id` FOREIGN KEY (`need_id`) REFERENCES `need` (`id`);
  
ALTER TABLE `donator`
  ADD CONSTRAINT `fk_donator_location_id` FOREIGN KEY (`location_id`) REFERENCES `location` (`id`);

# Transport ==============================================================================================================
ALTER TABLE `stock_vehicle`
  ADD CONSTRAINT `fk_stock_vehicle_transporter_id` FOREIGN KEY (`transporter_id`) REFERENCES `transporter` (`id`),
  ADD CONSTRAINT `fk_stock_vehicle_vehicle_id` FOREIGN KEY (`vehicle_id`) REFERENCES `vehicle` (`id`);
  
ALTER TABLE `shipment` 
  ADD CONSTRAINT `fk_donated_vehicle_transporter_id` FOREIGN KEY (`transporter_id`) REFERENCES `transporter` (`id`),
  ADD CONSTRAINT `fk_donated_vehicle_vehicle_id` FOREIGN KEY (`vehicle_id`) REFERENCES `vehicle` (`id`),
  ADD CONSTRAINT `fk_donated_vehicle_need_id` FOREIGN KEY (`need_id`) REFERENCES `need` (`id`);
  
ALTER TABLE `transporter`
  ADD CONSTRAINT `fk_transporter_location_id` FOREIGN KEY (`location_id`) REFERENCES `location` (`id`);

# Webform ==============================================================================================================
ALTER TABLE `webform`
  ADD CONSTRAINT `fk_webform_user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`);
    
ALTER TABLE `webform_location`
  ADD CONSTRAINT `fk_webform_location_webform_id` FOREIGN KEY (`webform_id`) REFERENCES `webform` (`id`),
  ADD CONSTRAINT `fk_webform_location_location_id` FOREIGN KEY (`location_id`) REFERENCES `location` (`id`);
  
  




